  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes bird banding results
  at Ninigret National Wildlife Refuge during the fall of 2008.  The Ninigret banding
  station opened nets on 29 August and closed them on 31 October for a total of 37
  days. Daily net hours and the number of open nets varied greatly depending on weather
  conditions, field personnel and capture rate. We had a total of 17 nets that we
  could open at any one time, but the most we ever ran was 13. We ran the nets for
  a total of 1320.25 net hours (one net open for 1 hour equals 1 net hour, rounded
  to the nearest quarter hour). Report includes total birds captured, capture rates,
  and species totals.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
